export class GraphicsEngine {
    constructor(private gl: WebGLRenderingContext) {}

    print() {
        console.log("graphics engine print", this.gl);
    }

    drawRectangle() {
        this.gl.fillStyle = "rgba(0, 0, 255, 1.0)";
        this.gl.fillRect(120, 10, 150, 150);
    }
}
